import React from "react";

function Slot(props) {
    // let x = props.one;
    // let y = props.two;
    // let z = props.three;
    let {x, y, z} = {props};

    if(x === y && y === z){
        return (
            <>
            <div className = "slot_styling">
                <h1>{x} {y} {z}</h1>
                <h3>All the Emojis are same</h3>
            </div>
            </>
        );
    }
    else{
        return (
            <>
            <div className = "slot_styling">
                <h1>{x} {y} {z}</h1>
                <h3>Emoji's are not same</h3>
            </div>
            </>
        )
    }
}
export default Slot;
